import { Sorter } from "./sorter";
import ReactStars from "react-rating-stars-component";

export const userColumns = [
  {
    title: "Fund Name",
    dataIndex: "Fund_Name",
    key: "Fund_Name",
    sorter: {
      compare: Sorter.DEFAULT,
      multiple: 1
    }
  },
  {
    title: "Ratings",
    dataIndex: "Ratings",
    key: "Ratings",
    sorter: {
      compare: Sorter.DEFAULT,
      multiple: 1
    }
  },
  {
    title: "5 STAR RATING BASED ON CONJOINTANALYSIS",
    key : "Ratings",
    render:(record) => {
      return (<ReactStars isHalf={true} size={30} defaultValue={2.5}/>);
      }
  }

];
